INSERT INTO `clubs` (`id`, `name`, `description`, `image`, `category`) VALUES
(1, 'Advanced Intelligence in Electronics and Mechanics (AIEM) Club', 'The Advanced Intelligence in Electronics and Mechanics (AIEM) Club at VIT Bhopal University is dedicated to exploring cutting-edge technologies that merge electronics and mechanics with artificial intelligence. As technology continues to evolve, we strive to stay ahead of the curve, promoting innovation and research in this interdisciplinary field. Through workshops, seminars, and hands-on projects, members will gain invaluable practical experience and theoretical knowledge, preparing them for the future of engineering. Join us to be a part of the revolution that is shaping the world with intelligent systems and groundbreaking advancements.\r\n\r\n\r\n\r\nContacts:\r\nDr. Soumitra K Nayak (100163)\r\nsoumitra.nayak@vitbhopal.ac.in', , 'Technical Club'),
(2, 'AI Club', 'The AI Club at VIT Bhopal University is a community of forward-thinkers and innovators passionate about Artificial Intelligence (AI). Our mission is to tackle industrial challenges and pave the way for a better future through AI-driven solutions. Join us to explore the limitless potential of AI in various domains, from healthcare and finance to automation and robotics. Through workshops, projects, and industry collaborations, we aim to equip members with the skills and knowledge needed to drive technological advancements and make a positive impact on society. Be a part of the AI revolution and shape the future together!\r\n\r\n\r\n\r\nContacts:\r\nDr. Ajeet Singh\r\najeetsingh@vitbhopal.ac.in', , 'Technical Club'),
(3, 'Android Club', 'The Android Club at VIT Bhopal University is for aspiring app developers and tech enthusiasts who gather here to dive into the exciting world of Android. Our club offers a hands-on learning experience, where members can create innovative mobile applications, explore the latest trends in Android development, and collaborate on real-world projects. Through workshops, coding challenges, and guest lectures from industry experts, we aim to nurture talent and empower students to excel in the ever-evolving Android ecosystem. Join us to unlock your potential, share ideas, and be part of shaping the future of mobile technology!\r\n\r\n\r\n\r\nContacts:\r\nDr. G.Ganeshan (100377)\r\nganesan.g@vitbhopal.ac.in', , 'Technical Club');
INSERT INTO `clubs` (`id`, `name`, `description`, `image`, `category`) VALUES
(4, 'Anime Club', 'Immerse yourself in the captivating world of anime and manga. As passionate anime enthusiasts, we celebrate the art, storytelling, and culture of Japanese animation. Join us for screenings, discussions, and events that explore various genres and classics. The club is a platform for like-minded individuals to connect, share recommendations, and discover the vast and diverse anime universe. Whether you’re a seasoned otaku or new to anime, this club welcomes everyone to embark on an exciting journey filled with creativity, friendship, and the magic of anime. Let’s experience the extraordinary together!\r\n\r\n\r\n\r\nContacts:\r\nDr. Kiran Pandey(100542)\r\nkiranpandey@vitbhopal.ac.in', , 'Technical Club');
INSERT INTO `clubs` (`id`, `name`, `description`, `image`, `category`) VALUES
(5, 'ANTERIX Club', 'ANTERIX is a celestial journey that delves into the wonders of the universe, space, and astronomy. Join us as we explore the mysteries of the cosmos, from distant galaxies to celestial phenomena. Through stargazing sessions, workshops, and guest lectures by astronomers and space enthusiasts, we aim to expand our knowledge and appreciation of the cosmos. Our club fosters a sense of wonder and curiosity, nurturing the next generation of space explorers and astronomers. Embark on this cosmic adventure with us and let the stars be your guide to an extraordinary universe of knowledge and fascination!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Prashant G K (100201)\r\nprashant.gk@vitbhopal.ac.in', , 'Technical Club');
INSERT INTO `clubs` (`id`, `name`, `description`, `image`, `category`) VALUES
(6, 'Antique Arcade Club', 'Immerse yourself in the world of historical architecture, exploring the beauty and craftsmanship of antique structures. Our club hosts engaging discussions, architectural tours, and workshops, celebrating the rich heritage of ancient buildings and their influence on modern design. Unearth the secrets of iconic landmarks and learn from architectural experts. Join us to connect with like-minded individuals, preserve architectural heritage, and appreciate the timeless elegance of the past in shaping the future of design. Let’s build a bridge between the past and present, one arch at a time!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Sheetal Sharma(100249)\r\nsheetal.sharma@vitbhopal.ac.in', , 'Technical Club'),
(7, 'Bioengineering Club', 'Welcome to The Bioengineering Club, we unite passionate undergraduates to revolutionize life sciences on our campus. Our tight-knit family fosters learning, innovation, and exploration at the intersection of engineering and life sciences. Join us, whether experienced or just starting, and together we’ll redefine bioengineering’s future, leaving a remarkable legacy for generations to come. Let’s embark on this exciting journey of learning and innovation together!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Arun Kumar K(100530)\r\narunkumar.k@vitbhopal.ac.in', , 'Technical Club');
INSERT INTO `clubs` (`id`, `name`, `description`, `image`, `category`) VALUES
(8, 'Blockchain Club', 'Blockchain Club is a vibrant and progressive group of blockchain aficionados. In order to promote information sharing and creativity, the club holds lively talks, workshops, and hackathons that are centered on examining the revolutionary potential of blockchain technology. Come explore the world of decentralized networks and game-changing apps with us.\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Anand Motwani (100118)\r\nanand.motwani@vitbhopal.ac.in', , 'Technical Club'),
(9, 'Bashcraft Club', 'We are a fraternity of innovators focusing more on Computer Science and it’s various domains. We dive deep into thorough explorations of emerging technology and emphasize the importance of practical applications of technology by creating new solutions. In the past, we have hosted webinars from reputed tech specialists like Zerodha and Tech entrepreneurs like Arpit Bhayani, reaching up to 300+ participants. Join us to enhance your knowledge, and bring your tech ideas to life and get a gist of what real engineering looks like. Here at BashCraft, we keep it no-fluff, just engineering!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Dheresh Soni (100415)\r\ndheresh.soni@vitbhopal.ac.in', , 'Technical Club'),
(10, 'Cloud Zone ', 'The Cloud Zone club at VIT Bhopal University is dedicated to empowering students with the knowledge and skills of cloud computing. Whether you’re a beginner or an experienced enthusiast, join us to delve into the world of cloud technologies, platforms, and services. Through hands-on workshops, tutorials, and projects, we aim to equip members with practical expertise in cloud computing. From deploying applications to managing data securely, we explore the limitless potential of cloud technology. Prepare to soar high in the digital realm and embrace the power of the cloud. Join Cloud Zone and elevate your tech prowess to new heights!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Virendra Singh Kushwah (100212)\r\nvirendra.kushwah@vitbhopal.ac.in', , 'Technical Club'),
(11, 'Coding Blocks', 'The Coding Blocks at VIT Bhopal University, also known as the Bit By Bit Club, is a hub where innovation flourishes with every line of code. We are committed to nurture a dynamic community that prioritizes idea sharing and skill enhancement. Our club provides opportunities in competitive coding, web development, and app creation through interactive workshops and exciting hackathons. From overcoming real-world challenges to creating innovative solutions, our vibrant coding ecosystem encourages continuous learning and knowledge sharing. Join us to unlock your coding potential and pave the way for a successful tech career. Let’s create a block of code together!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. S. Aanjankumar(100432)\r\naanjan.kumar@vitbhopal.ac.in', , 'Technical Club');
INSERT INTO `clubs` (`id`, `name`, `description`, `image`, `category`) VALUES
(12, 'D2C Igniters Club', 'We are a group of enthusiastic and driven individuals who thrive on competition and love pushing our limits. Join us to participate in various competitions, hackathons, quizzes, and challenges across different domains. As Igniters, we inspire each other to excel and ignite the flames of ambition and success. Through workshops and mentorship, we aim to sharpen skills, foster teamwork, and embrace a competitive spirit in a healthy and supportive environment. Dare to compete, ignite your passion, and let your potential shine bright with the Igniters Club!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Subhash Chandra Patel(100194)\r\nsubhash.patel@vitbhopal.ac.in', , 'Technical Club'),
(13, 'Data Science Club', 'Get ready to unlock the boundless potential of data science and analytics. Join us to explore the world of big data, machine learning, and artificial intelligence. Through workshops, hands-on projects, and guest lectures, we delve into real-world applications and insights. Our club fosters collaboration and innovation, empowering members to tackle complex problems and extract valuable knowledge from data. Whether you’re a beginner or an experienced data enthusiast, the Data Science Club provides a platform to harness the power of data and shape a data-driven future. Let’s embark on this data-driven journey together!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Abha Trivedi(100259)\r\nabhatrivedi2021@vitbhopal.ac.in', , 'Technical Club'),
(14, 'E-Cell', 'Entrepreneurship Cell is dedicated to fostering an entrepreneurial spirit, nurturing creativity, and inspiring students to turn their ideas into successful ventures. Through workshops, mentorship programs, startup pitches, and networking events, we provide the platform and resources to transform entrepreneurial dreams into reality. Join us to connect with like-minded individuals, access valuable industry insights, and embark on a journey of growth and entrepreneurship. Let’s create the next generation of leaders and disruptors together at E-Cell!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Magatharajan (100299)\r\nmagatharajan@vitbhopal.ac.in', , 'Technical Club'),
(15, 'Edu4U', 'The Education Technology Club at VIT Bhopal University embraces both facets of educational technology: technology for education and technology of education. Our club is dedicated to exploring the seamless integration of ICT tools into the teaching-learning process, making education more accessible and engaging. Additionally, we focus on developing cutting-edge tools and solutions to enhance the teaching-learning experience through technical knowledge. Through discussions, workshops, and projects, we delve into the analysis, design, development, implementation, and evaluation of instructional environments and learning materials. Join us to be part of this transformative journey, improving teaching and learning for a brighter future. Together, let’s shape the future of education through technology at Edu4U!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Bandla Pavan Babu (100593)\r\nbandlapavanbabu@vitbhopal.ac.in', , 'Technical Club');
INSERT INTO `clubs` (`id`, `name`, `description`, `image`, `category`) VALUES
(16, 'E – Green Club', 'E – green is a club focused on sustainable development and science technology. We aim to bridge the gap between science, technology, and sustainability, inspiring positive change within our community. Through workshops, seminars, hackathons, and innovation challenges, members learn, innovate, and contribute to sustainable development. By fostering an inclusive environment, we encourage exploration, skill development, and meaningful connections with like-minded individuals. Join us to be part of a dedicated community making a difference, collaborating on exciting projects, gaining insights from experts, and actively working towards a more sustainable future.\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Jayanthi J (100531)\r\njayanthi@vitbhopal.ac.in', , 'Technical Club'),
(17, 'E-Commerce Club', 'E-Commerce Club at VIT Bhopal University is the hub for tech-savvy shopaholics and aspiring e-commerce enthusiasts. Our club goes beyond websites and apps, providing a dynamic space to foster valuable connections and cultivate cutting-edge skills. Join us to explore the ever-evolving world of online retail, digital marketing, and entrepreneurship. Through interactive workshops, industry insights, and collaborative projects, we empower members to thrive in the e-commerce landscape. Be a part of our vibrant community and embark on an immersive journey to shape the future of online shopping and business. Let’s navigate the world of e-commerce together!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Sukumar. R (100474)\r\nsukumar.r@vitbhopal.ac.in', , 'Technical Club');
INSERT INTO `clubs` (`id`, `name`, `description`, `image`, `category`) VALUES
(18, 'Electric Vehicle Club', 'As pioneers of sustainability and innovation, we are driving the future of transportation. Our club is dedicated to promoting electric mobility and exploring the cutting-edge world of electric vehicles (EVs). Join us to learn about EV technology, design, and development. Through hands-on projects, workshops, and guest lectures from industry experts, we aim to foster a deeper understanding of clean energy and its impact on the environment. Be part of this electrifying journey as we pave the way towards a greener and more sustainable future. Let’s accelerate the transition to electric mobility together at the Electric Vehicle Club!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Ajay Sharma (100513)\r\najaysharma@vitbhopal.ac.in', , 'Technical Club'),
(19, 'Fraternity of Young Innovators Club', 'We are a collective of dynamic and curious minds, driven by a passion for innovation and creativity. Our club serves as a platform to nurture and celebrate young innovators from diverse disciplines. Through ideation sessions, design thinking workshops, and prototyping challenges, we encourage members to explore their creativity and transform ideas into reality. Join us to collaborate with like-minded individuals, unlock your potential, and push the boundaries of innovation. Let’s create a vibrant community of change-makers and revolutionize the world with our ingenuity and imagination. Together, we are the Fraternity of Young Innovators!\r\n\r\n\r\n\r\n\r\nContacts:\r\nDr. Siddhartha Maiti (100203)\r\nsiddhartha.maiti@vitbhopal.ac.in', , 'Technical Club');

